interface PropTypes {
  socialMedia: Object[];
}

const Social: React.FC<PropTypes> = ({ socialMedia }) => {
  return (
    <StyledSocialList>
      {socialMedia.map((icon: any, index: number) => (
        <li key={index}>
          <a href={icon.url} aria-label={icon.name}>
            dwad
          </a>
        </li>
      ))}
    </StyledSocialList>
  );
};

export default Social;
